import Home from './components/Home';
import Course from './components/Course';
import AllCourses from './components/AllCourses';
import Menus from './components/Menus';

function App() {
  const notify = () => {
    toast.success("Done!");
    // toast.error("error in code");
  };

  return (
    <div className="App">

      <ToastContainer/>
      <Container>
        <Row>
          <Col>
            <Menus/>
          </Col>  
          <Col>
            <Home/>
          </Col>
        </Row>  
      </Container>    
    </div>
  );
}

export default App;
